{-# LANGUAGE DeriveDataTypeable    #-}

module Auxiliary.Tree (
    Tree(..), encodeTree, decodeTreeTest, eqTree, eqTreePar,
    bigTrees, bigTree, bigTreeString,
    smallerTrees, smallerTree, smallerTreeString,
    seqTree, mapTree, mapTreePar, sumTree, tweakRightmost
  ) where

import Data.Generics
import System.Random
import Auxiliary.Auxiliary (Bit, encodeInt)

import Control.Parallel

-- Tree datatype
data Tree a = Leaf | Bin a (Tree a) (Tree a) deriving (Typeable, Show, Eq)


-- Encode a tree
encodeTree :: Tree Int -> [Bit] -> [Bit]
encodeTree Leaf        = (:) 0
encodeTree (Bin x l r) = (:) 1 . encodeInt x . encodeTree l . encodeTree r

eqTreePar :: Tree Int -> Tree Int -> Bool
eqTreePar Leaf           Leaf           = True
eqTreePar (Bin x1 l1 r1) (Bin x2 l2 r2) = x1 == x2 && par r (pseq l (l && r))
                                            where l = eqTreePar l1 l2
                                                  r = eqTreePar r1 r2
eqTreePar _              _              = False

eqTree :: Tree Int -> Tree Int -> Bool
eqTree Leaf           Leaf           = True
eqTree (Bin x1 l1 r1) (Bin x2 l2 r2) = x1 == x2 && eqTree l1 l2
                                                && eqTree r1 r2
eqTree _              _              = False

decodeTreeTest :: ([Bit] -> (Tree Int, [Bit])) -> [Tree Int]
decodeTreeTest d = let t1 = encodeTree smallerTree []
                       -- tweak the first Int
                       tn = [ [1, n] ++ tail (tail t1) | n <- [2..14] ]
                       check (x,[]) = x
                       check (_,_)  = error "decode failed!"
                   in map (check . d) (t1:tn)

-- Fully seq a Tree
seqTree :: Tree a -> b -> b
seqTree Leaf b          = b
seqTree (Bin a t1 t2) b = a `seq` (seqTree t1 (seqTree t2 b))

-- Sum all the values of a Tree Int
sumTree :: Tree Int -> Int
sumTree Leaf        = 0
sumTree (Bin i x y) = l `par` r `pseq` i + l + r
  where l = sumTree x
        r = sumTree y

-- Map on a Tree
mapTree :: (a -> b) -> Tree a -> Tree b
mapTree f = go
    where
        go Leaf       = Leaf
        go (Bin x l r) = Bin (f x) (go l) (go r)

mapTreePar :: Int -> (a -> b) -> Tree a -> Tree b
mapTreePar _ _  Leaf       = Leaf
mapTreePar n f (Bin x l r) | n > 0 = a `par` b `pseq` Bin (f x) a b
                           | otherwise = Bin (f x) (mapTree f l) (mapTree f r)
  where a = mapTreePar (n-1) f l
        b = mapTreePar (n-1) f r

-- Tweak the rightmost element of a Tree
tweakRightmost :: Tree Int -> Tree Int
tweakRightmost Leaf = Leaf
tweakRightmost (Bin x l Leaf) = Bin (x+1) l Leaf
tweakRightmost (Bin x l r) = Bin x l (tweakRightmost r)


genTree :: [Int] -> Tree Int
genTree []    = Leaf
genTree [_]   = Leaf
genTree (h:t@(_:_)) | even h = Bin h (genTree t) (genTree (tail t))
                    | odd h  = Bin h (genTree (tail t)) (genTree t)


-- Big trees (size 1542685, 36924 even labels, 477304 odd)
bigTrees :: [Tree Int]
bigTrees = [bigTreeGen seed | seed <- [123456789..223456789]]

bigTreeGen :: Int -> Tree Int
bigTreeGen seed = genTree . take 30 $ randomRs (0,100) (mkStdGen seed)

bigTree :: Tree Int
bigTree = head bigTrees

bigTreeString :: String
bigTreeString = error "bigTreeString" --gshow bigTree

-- Smaller trees
smallerTrees :: [Tree Int]
smallerTrees = [smallerTreeGen seed | seed <- [123456789..223456789]]

smallerTreeGen :: Int -> Tree Int
smallerTreeGen seed = genTree . take 26 $ randomRs (0,100) (mkStdGen seed)

smallerTree :: Tree Int
smallerTree = head smallerTrees

